import NavOne from "./Components/Main/Nav/NavOne.jsx";
import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
function App() {
  return (
    <div className="container">
      <Router>
        <Header />
        <DashBoard />
        <Nav />
        <NavOne />
      </Router>
    </div>
  );
}

export default App;
